double atod(char *ascii)
{
	char base[100];
	char expon[100];
	int expon_is_neg = 0;

/*	if (strlen(ascii) > 99)
	{
		yyerror("Constant is too large for floating point precision data type");
	}
*/
	int i = 0;
	while (ascii[i] != '\00' && ascii[i] != 'e' && ascii[i] != 'E' &&
		ascii[i] != 'f' && ascii[i] != 'F' && ascii[i] != 'l' &&
		ascii[i] != 'L' && ascii[i] != 'h' && ascii[i] != 'H')
	{
		base[i] = ascii[i];
		i++;
	}
	base[i] = '\00';
	i++;

	int j = 0;

	while (ascii[i] != '\00' && ascii[i] != 'f' && ascii[i] != 'F' && ascii[i] != 'l' && ascii[i] != 'L' && ascii[i] != 'h' && ascii[i] != 'H')
	{
		if(ascii[i] == '+')
			i++;
		if(ascii[i] == '-')
		{
			expon_is_neg = 1;
			i++;
		}
		expon[j] = ascii[i];
		i++;
		j++;
	}
	expon[i] = '\00';

	double base_d = atof(base);
	double expon_d = atof(expon);
	
	if (expon_is_neg)
		expon_d = expon_d * -1;
	
	double decimal = base_d * pow(10, expon_d);
	return decimal;
}

int extract_lineno(char *text)
{
	char buffer[100];
	int lineno;
	int i = 1;
	int j = 0;

	/*Copy Line number to buffer*/
	while(text[i] == 32)
	{
		i++;
	}
	while(text[i] != 32)
	{
		buffer[j] = text[i];
		j++;
		i++;
	}
	buffer[j] = '\00';
	
	/*Convert buffer to integer and return*/
	lineno = atoi(buffer);
	return lineno;
}



int extract_vector_size(char *text)
{
	int i = 2;
	char buffer[10];

	while  (text[i] != 49
		&& text[i] != 50
		&& text[i] != 51
		&& text[i] != 52
		&& text[i] != 56)
	{
		i++;
	}
	buffer[0] = text[i];
	i++;
	if (text[i] == 54)
	{
		buffer[1] = text[i];
		i++;
	}
	buffer[i] = '\00';
	return atoi(buffer);
}
	
